INSERT INTO `v1_5d01802fa390e445fe1d6f48ca614dd096e6b012cf502c1259d5b9295d15a842` VALUES ("vo_minigame_1013_icon_2_003_001", 2, 2, 2, "ほらほら、\nまだいけるだろ？", 3000, 2, 5000, "クスクス、悪くない\n流れですわね", "vo_minigame_1013_icon_1_003_001");
INSERT INTO `v1_5d01802fa390e445fe1d6f48ca614dd096e6b012cf502c1259d5b9295d15a842` VALUES ("vo_minigame_1013_icon_2_004_001", 2, 2, 3, "へへっ、おまえら\nやるじゃねえか！", 3000, 3, 10000, "すばらしい\n記録ですわ", "vo_minigame_1013_icon_1_004_001");
INSERT INTO `v1_5d01802fa390e445fe1d6f48ca614dd096e6b012cf502c1259d5b9295d15a842` VALUES ("vo_minigame_1013_icon_2_005_001", 3, 2, 4, "あたしたちはまだ\n止まらねえぜ！", 3000, 3, 10000, "乗りに乗って\nいますわね", "vo_minigame_1013_icon_1_005_001");
