INSERT INTO `v1_5d01802fa390e445fe1d6f48ca614dd096e6b012cf502c1259d5b9295d15a842` VALUES ("vo_minigame_1013_icon_2_005_003", 3, 2, 6, "うおぉぉっ！\n絶好調だぜ！", 3000, 3, 10000, "エリコ班の\n本領発揮ですわ！", "vo_minigame_1013_icon_1_005_003");
